				duration:5,
				fadeDuration:2,		
				url:"",
				groupSet:0,
				imgHeight:440			}
		,			{
				fileName:"DLC01.jpg",
				fullFilePath:"/files/6715/8266/9779/DLC01.jpg",
				duration:5,
				fadeDuration:2,		
				url:"",
				groupSet:0,
				imgHeight:401			}
		,			{
				fileName:"FBLA.jpg",
				fullFilePath:"/files/8415/8267/0145/FBLA.jpg",
				duration:5,
				fadeDuration:2,		
				url:"",
				groupSet:0,
				imgHeight:401			}
